import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Typography,
  Box,
  Button,
  Grid,
  Card,
  CardContent,
  CardMedia,
  IconButton,
} from '@mui/material';
import { RemoveCircle as RemoveIcon, AddCircle as AddIcon, Delete as DeleteIcon } from '@mui/icons-material';

const Cart = () => {
  const navigate = useNavigate();

  return (
    <Container sx={{ py: 8 }}>
      <Typography variant="h4" component="h1" sx={{ mb: 4, color: 'white' }}>
        Shopping Cart
      </Typography>

      <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', mt: 4 }}>
        <Typography variant="h6" sx={{ color: 'rgba(255,255,255,0.7)', mb: 2 }}>
          Your cart is empty
        </Typography>
        <Button
          variant="contained"
          onClick={() => navigate('/products')}
          sx={{
            bgcolor: '#7c4dff',
            '&:hover': {
              bgcolor: '#6c3fff',
            },
            mt: 2,
          }}
        >
          Continue Shopping
        </Button>
      </Box>
    </Container>
  );
};

export default Cart;
